import { Plus } from "@phosphor-icons/react";

const Left = () => {
    return (
      <div style={{width:"71px", textAlign: 'center', marginTop:"24px"}}>
        <div
            style={{
              width: "26px",
              height: "26px",
              borderRadius: "100px",
              background: "#000000",
              color: "#A0A0A0",
              border: "none",
              cursor: "pointer",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              textAlign:"center"
            }}
          >
            <Plus size={20} color="#FFF" weight="bold" />
          </div>
      </div>
    );
  };

  export default Left;
